import { ethers } from 'ethers';
var CORE_NAMESPACE = ethers.utils.solidityKeccak256(['string'], ['core']);
var APP_ADDR_NAMESPACE = ethers.utils.solidityKeccak256(['string'], ['app']);
var APP_BASES_NAMESPACE = ethers.utils.solidityKeccak256(['string'], ['base']);
var KERNEL_NAMESPACES_NAMES = new Map([[CORE_NAMESPACE, 'Core'], [APP_ADDR_NAMESPACE, 'Default apps'], [APP_BASES_NAMESPACE, 'App code']]);
export function getKernelNamespace(hash) {
  return KERNEL_NAMESPACES_NAMES.has(hash) ? {
    name: KERNEL_NAMESPACES_NAMES.get(hash),
    hash: hash
  } : null;
}
